import Link from "next/link";

// export default () => (
//   <div>
//     Hello Next.jsh3 <h3>testColor</h3>
//   </div>
// );
// npm run dev //terminal

// better sentance
const Index = () => (
  <div>
    <ul>
      <li>
        <Link href="/">
          <a>Home</a>
        </Link>
      </li>
      <li>
        <Link href="/about">
          <a>About</a>
        </Link>
      </li>
    </ul>
    <h3>Welcome to Next</h3>
  </div>
);

export default Index;
